    [],nt"num_tags": 13,nt"name": "initial-survey-instructions-for-streaked-horned-lark-monitoring-habitat",nt"isopen":
    false,nt"url": null,nt"notes": "The endemic subspecies of the Pacific coastal
    form of horned lark is found only in western Oregon and Washington. As its population
    and distribution has decreased significantly with a decline in available habitat,
    it is now restricted to a few large open grassland sites, coastal beaches, airports,
    and islands in Washington (Stinson 2005) and several sites along the lower Columbia
    River, in the Willamette Valley, and at the Corvallis Airport in Oregon. The streaked
    horned lark was federally listed as a threatened species on October 3, 2013. It
    is state listed in Washington as endangered. The population is estimated by Altman
    (2011) at less than 2,000 birds. Streaked horned larks occur on Willapa National
    Wildlife Refuge in suitable habitat at the Leadbetter Point Unit and on adjacent
    State Park lands.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
